import '../App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import axios from 'axios';
import '../assets/css/buscador.css'



function Upload() {


  return (

    <>
    <div className="App">

      <input type="file" name="files"></input>
      <button className="btn btn-lg boton-pur btn-block">Subir</button>

    </div>
    
    </>
    
  );
}


export default Upload;
